text:
"애센 고시 승인받았습니다.이 승인을 받기 전에는 이미 이 블로그로 한 번 신청했다가 거절당했어서, 이 블로그말고 다른 쪽으로 해볼까 고민해서 다른 블로그를 다시 만들던 중,
다시 애센 신청해봤는데 어떻게 몇 시간만에 바로 승인 받았네요;
여러분들의 집단 지성 및 토론을 통한 정보 덕분에 이런 값진 결과를 얻은 것 같습니다."

"제가 저번에 사이트 테마 적용 후 키워드 검색했을때 노출이 안돼서 샌드박스나 스팸당한거 같다고 물어봤었습니다. 신기하게도 방금 방금 확인해봤는데 얼마전 작성한 일부 글들은 노출이 되네요. ?? 
되고 안되는 기준을 모르겠네요;; 
뭐지? "
